RootCause:
File location: Metrica\classes
File name : Results.cs
Method name: SendIndividualTestInstanceIntegration()

The everythingProcessed is set to true at the beginning of the method. This method does not contain any matching items for Elit listed in the description part. 

Hence everythingProcessed is processed is never set to false if the record is not set.

Once the control reaches the below code, it just processed the record with out taking any action which in turn removes the record from the resend responses grid.

if (everythingProcessed)
                    {
                        // Everything was OK, show that the data was sent
                        testInstanceIntegration.WhenSent = DateTime.UtcNow;
                        testInstanceIntegration.WhenProcessed = null;
                        testInstanceIntegration.Update();
                    }

We have discovered after SAS, that the STED RO excel report in IWAS (Reports > Candidates Reports > Export to Excel > STED Recognizing Organizations) is pulling STED ROs which have been deleted, as well as those are active. PFB the SQL query, which is fetching records from IWAS database for this report:
SELECT * FROM  RECOGNIZING_ORGANIZATIONS RO  WHERE RO.STATUS IN ('T','F');

Required below changes in above mentioned SQL query (highlighted) for this report to fetch active STED ROs only.
SELECT * FROM  RECOGNIZING_ORGANIZATIONS RO  WHERE RO.STATUS IN ('T','F') AND RO.IS_DELETED = 'N';

Within the Maintain Recognizing Organizations section of IWAS (Candidate Management > Maintain Recognizing Organizations), only active STED ROs are displayed in the UI, and in any csv/PDF exports. This is correct behavior.

Workaround:
The following script will need to be run (has already been run in PRD as part of incident 512505)
UPDATE IELTS_USER_PREFERENCE SET PREFERENCE_VALUE='PB_IELTS'      WHERE PREFERENCE_NAME='UI_CONTEXT_EXAM_TYPE' AND PREFERENCE_VALUE='IELTS';
COMMIT;

