RootCause:
There was two issues here;
1) The initial root cause of this PR was the ODBCINI environment variable was configured incorrectly on upsapap153 application server which was causing intermittent ODBC connection issues. 
2) The 2nd issue was the BODS job schedule getting messed up due to the BODS team trying to implement a workaround by moving the jobs on to a separate app server and then moving it back - it caused time scheduling issues.

Resolution:
*** Subsequently closed without implementation because the servers have since been upgraded and no further issues encountered.

Below run on RFC #18239 BUT Rolled Back due to services needing to be stopped and need for thorough testing around locking being raised. Note, as performance related this may be resolved during the server upgrade - so suggest monitor post upgrade, and assess if the changes is still required. See resolution plan for next steps.

Before proceeding take a copy of the config values for each database, this will form the rollback plan.

On EPOUATAG01\SQL01, run the below on CentreAssessmentManager and CandidateEntryManager databases :-

ALTER DATABASE [<DatabaseName>] SET RESTRICTED_USER WITH ROLLBACK IMMEDIATE;

ALTER DATABASE [<DatabaseName>] SET READ_COMMITTED_SNAPSHOT ON;

ALTER DATABASE [<DatabaseName>] SET MULTI_USER WITH ROLLBACK IMMEDIATE;

If rollback required, then reset the values to the pre change values.

