getAllCentres.CentreLiteDAOImpl.java(Line : 66) has explicitly mentioned :
criteria.add(Restrictions.eq(propertyName:"closed", value:false));

This stops the closed centres from being visible to the IELTS Admin user.

The duplicate data is coming because the procedure is getting userId as 0 in all cases due to 'GetDefaultParameters' method in ‘Cie.Odts.Reporting.Repositories\Repositories\BaseReportRepository.cs’.

protected static DynamicParameters GetDefaultParameters(CieOdtsDbContext context, int userId, int? programmeId)
{ var parameters = new DynamicParameters(); var user = context.Users.First(x => x.Id == userId); parameters.Add("userId", OrganisationalRoles.Contains(user.Role) ? 0 : userId); ... } 
Due to this, the data is coming no. of times a learner group is attached to no. of users.

Need to discuss the current logic: parameters.Add("userId", OrganisationalRoles.Contains(user.Role) ? 0 : userId);

If we modify the code as below, Correct report will get generated.
parameters.Add("userId", OrganisationalRoles.Contains(user.Role) ? userId: 0 );

