Workaround:
The bounce of the database made Oracle use a different plan for the statement causing the high CPU.

If this happens again, we can perform the following :

1) Implement the baseline of a preferred plan (a “good” plan seems to be 788552215 (there is also another one as an option 175393460)) :

SQL> variable cnt2 number; 
SQL> execute :cnt2 :=DBMS_SPM.LOAD_PLANS_FROM_CURSOR_CACHE(sql_id=>'9xj7208rh0qhr ',plan_hash_value=>788552215); 

